import { FieldType } from "./deserialization/FieldType";
import JsonDeserializationHelper from "./deserialization/JsonDeserializationHelper";
import { Room } from "./Room";

export default class Rooms {
    readonly rooms : Room[];

    constructor(rooms : Room[]) {
        this.rooms = rooms;
    }

    static deserialize = (json : any) => {
        const rooms = JsonDeserializationHelper.assertField(json, 'rooms', FieldType.ARRAY(Room.deserialize));

        return new Rooms(rooms);
    }
}
